import React from 'react';
import './MoviesCard.css';
import moviePic from '../../images/movie_card.png';

function MoviesCard() {
  return (
    <div className='movies-card'>
      <img
        className='movies-card__pic'
        alt='Обложка фильма'
        src={moviePic}
      />
      <div className='movies-card__info'>
        <p className='movies-card__name'></p>
        <p className='movies-card__duration'></p>
      </div>
    </div>
  );
}

export default MoviesCard;
